                  function OnClientDropDownClosing(sender, args) {
                      if (args.get_domEvent() != null) {
                          if (args.get_domEvent().target == sender.get_imageDomElement()) {
                              args.set_cancel(false);
                          }
                          else {
                              args.set_cancel(true);
                          }
                      }
                  }

                  function OnClientBlur(sender, args) {
                      sender.hideDropDown();
                  }

                  function OnClientSelectedIndexChanged(sender, args) {
                      var items = sender.get_items();
                      var item = args.get_item();
                      for (i = 0; i < items.get_count(); i++) {
                          if (items.getItem(i) == item) {
                              items.getItem(i).get_element().style.textDecoration = "underline";
                          }
                          else {
                              items.getItem(i).get_element().style.textDecoration = "none";
                          }
                      }

                      setPlaceholder();
                  }
