                                 <td>
                                    <div class="clear"></div>
                                    <div id="pnlContent" class="content">
                                       <p>From the Add Schedules menu, you can add a new schedule or edit an existing schedule.</p>
                                       <p>To edit a schedule, click the pencil icon next to it. To add a new schedule, click Add a new schedule.</p>
                                       <p><img alt="" src="../../images/class/iplschedule1.jpg" style="width: 700px;"></p>
                                       <p><img alt="" src="../../images/class/iplschedule2.jpg" style="width: 700px;"></p>
                                       <p>In the Add a new schedule area, complete all required fields, which are noted by a red asterisk. Because more than one schedule can be attached to a class, provide a specific schedule name. The start date should reflect the actual first day that students should be able to view content. Additional fields will appear as selections are made from the drop-down menus.</p>
                                       <p><img alt="" src="../../images/class/6 add a new schedule.png" style="width: 500px;"></p>
                                       <p>Select a license from the Select license drop-down menu. To schedule a Module on a rotational schedule, select Module Schedule or Math Module Schedule (if you are creating a schedule for a math class) from the Select a schedule type drop-down menu.</p>
                                       <p><strong>Note:</strong> Select Whole Class Assignment from the Select schedule type drop-down menu to <a target="_self" href="">schedule Orientation</a></p>
                                       <p><img alt="" style="width: 250px;" src="../../images/class/7-select schedule type.png"></p>
                                       <p>After you select the schedule type, the fields below appear.</p>
                                       <p><strong>Number of copies</strong> refers to the number of copies of Module titles in the class. (You can schedule multiple copies of all Modules but not select Modules.)</p>
                                       <p><strong>Number of rotations</strong> should reflect the number of rotations the class will complete.</p>
                                       <p><strong>Rotation length</strong> should be set for the number of days the class should spend on each rotation. The computer will not calculate weekends in the rotational schedule, but it is unable to recognize holidays.</p>
                                       <p><img alt="" style="width: 500px;" src="../../images/class/8 number of copies.png"></p>
                                       <p>All Modules in your license will automatically be listed in the Modules in your class field. If you have Modules for multiple classes, you will need to make sure only the Modules you need to schedule are listed in the Modules in your class field. Click the trash can icon to the right of the incorrect title to remove it from your list or click remove all modules and then add them one by one form the Modules field. Titles can also be dragged between the Modules and Modules in your class fields.</p>
                                       <p><img alt="" style="width: 500px;" src="../../images/class/9 confirm module titles.png"></p>
                                       <p>If you want to schedule extended content, click Extend Content to see a list of Modules that have extended content. Select title you want to include from the Select Extend Content drop-down menu.</p>
                                       <p><img alt="" style="width: 500px;" src="../../images/class/Extend1.jpg"></p>
                                       <p><img alt="" style="width: 300px;" src="../../images/class/Extend2.jpg"></p>
                                       <p>Click Generate.</p>
                                       <p><img alt="" style="width: 150px;" src="../../images/class/10 generate.png"></p>
                                       <p>A blank Review Your New Class Schedule area will appear.</p>
                                       <p><img alt="" style="width: 500px;" src="../../images/class/packeddispersed.png"></p>
                                       <p>To manually create your schedule, click in each cell and select a student to schedule into the Modules within each rotation.</p>
                                       <p><img alt="" style="width: 500px;" src="../../images/class/manualschedule2.jpg"></p>
                                       <p>To have <em>Synergy</em> generate a schedule, adjust your start and end rotations as desired and click Regenerate.</p>
                                       <p>To schedule only one rotation, set Start Rotation to 1 and End Rotation to 1. A schedule will be created in which students are randomly assigned content and partners.<br>
                                          <br>
                                          Select Packed or Dispersed. When Packed is selected, preference is to pair students together rather than spread them out across all Modules. When Dispersed in selected, <em>Synergy</em> spreads students across all Modules. If you have a full class (12 Modules and 24 students, for instance), either can be selected.
                                       </p>
                                       <p><strong>Note:</strong> The Auto Block feature should be used only when students will be in the same lab multiple years. When this feature is enabled, the system will not permit a student to be scheduled into a Module that they have already experienced.</p>
                                       <p><img alt="" style="width: 500px;" src="../../images/class/moduleschedule.png"></p>
                                       <p>Click Save if satisfied with the schedule. Click Reset to reconfigure names in the schedule.</p>
                                       <p><img alt="" style="width: 250px;" src="../../images/class/13 reset or save.png"></p>
                                       <p>To delete a student from a rotation, hover over the name. The name will be highlighted and an X will appear. Click X to delete the student.</p>
                                       <p><img alt="" style="width: 300px;" src="../../images/class/deletestudent2.jpg"></p>
                                       <p>To add a student to an empty cell, click in the cell, and the list of students within the class will appear. Select the student you wish to add.</p>
                                       <p><strong>Note:</strong> If there is a conflict, a message box will notify you that a student will be scheduled in a rotation more than once or the student is already scheduled into that Module in another rotation. You must confirm or decline the change before moving on.</p>
                                       <p><img alt="" style="width: 300px;" src="../../images/class/confirmation.jpg"></p>
                                       <p>The following additional modifications can be made when you are editing a schedule.</p>
                                       <p>A Module can be removed from the schedule by clicking the Module title. Click Yes in the dialog box to delete the Module.</p>
                                       <p><img alt="" style="width: 500px;" src="../../images/class/deletemodule.jpg"></p>
                                       <p>If removing a Module causes a problem with the number of seats available, a red message will appear.</p>
                                       <p><img alt="" style="width: 500px;" src="../../images/class/errormessage.jpg"></p>
                                       <p>A new Module can be added to the schedule by scrolling to the bottom of the Modules column and clicking Add a module. Select the Module you would like to add from the Select Module drop-down menu in the dialog box.</p>
                                       <p><img alt="" style="width: 500px;" src="../../images/class/addmodule.jpg"></p>
                                       <p><img alt="" style="width: 500px;" src="../../images/class/17a add module.png"></p>
                                       <p>Scroll to the end of the rotation row and click the plus sign to add a rotation to the schedule.</p>
                                       <p><img alt="" style="width: 400px;" src="../../images/class/17b add a rotation to a schedule.png"></p>
                                    </div>
